import React from 'react'
import { Outlet , Redirect } from 'react-router-dom'
const ProtectedRoutes = () => {
    const auth = localStorage.getItem('loggedin');
    return auth === 'true' ? (
      <Outlet />
    ) : (
      <Redirect to="/login" />
    )
 
}

export default ProtectedRoutes
